import React from 'react'
import Pic1 from '../images/FLASH STAMP MACHINE ACCESSORIES/BASE-FILM-1.jpg'
import Pic2 from '../images/FLASH STAMP MACHINE ACCESSORIES/'
import Pic3 from '../images/FLASH STAMP MACHINE ACCESSORIES/BASE-FILM-1.jpg'

import { useNavigate } from 'react-router-dom';

export default function FlashStampMachineAccessories() {
   const data = [
    {id: 1 , title:"Product 1 " , description:"This Product is Perfect " , image: Pic1 },
    {id: 2 , title:"Product 2 " , description:"This Product is Perfect " , image: Pic2 },
    {id: 3 , title:"Product 3 " , description:"This Product is Perfect " , image: Pic3 },
    
   ];

   const navigate = useNavigate()

   const handleContact = ()=>{
       navigate("/contactus");
   }

  return (
    <>
     <div className="container">
        <div className="cards-container">
     {
        data.map((item)=>(
            <div key={item.id} className='card'>
                <img src={item.image} alt={item.title} className='card-image' />
                <div className='card-contant'>
                    <h3>{item.title}</h3>
                    <p>{item.description}</p>
                    <button
                    onClick={handleContact}
                    className='card-button'
                    >
                       Details
                    </button>
                </div>
            </div>
        ))
     }


        </div>
        
        </div> 



    </>
  )
}
